From Alexandre Gordo, one of our Game Design Students: 
&quot;Sweden is full of amazing experiences. Working with these people on the Computer Game Design course was for sure one of the best ones. Very hardworking and creative guys that helped me designing my first complete videogame &quot;Aschizocats&quot; 󾌱 
É do vosso conhecimento as minhas extraordinárias skills de programador e portanto o jogo está a &quot;crashar&quot; no Android, mas assim que estiver pronto... bem... preparem-se ahah&quot;
